describe("test NewGalleryController", function () {
    var $httpBackend, $rootScope, createController;

    var fakeCreateGalleryResponse = { GalleryId: "302FF471-0FF5-48D1-A476-A2DC6526DFB8" };

    var fakeFilesToUpload = [
        {
            name: 'test1.jpg',
            size: 12345,
            type: 'image/jpeg'
        },
        {
            name: 'test2.jpg',
            size: 45678,
            type: 'image/jpeg'
        }
    ];

    var fakePutUrl = 'api/gallery/302FF471-0FF5-48D1-A476-A2DC6526DFB8/image';

    // Mock the angular-file-upload 
    var FakeUploadService = function (httpSvc) {
        this.upload = function (config) {

            // better be calling a fake put
            httpSvc.put(config.url);

            // return a fake promise
            var fakePromise = function (c) {
                this.progress = function (progressFunc) { return this; },
                this.success = function (successFunc) {
                    successFunc({ param: "data, not used" },
                        { param: "status, not used" },
                        { param: "error, not used" },
                        c);
                    return this;
                },
                this.error = function (errorFunc) { return this; }
            };
            return new fakePromise(config);
        }
    }

    var FakeFileReaderService = function ($q) {

        var fakeDataUrl = 'data:image/jpeg;base64,';

        this.readDataUrl = function (file) {
            var defer = $q.defer();

            defer.resolve(fakeDataUrl);

            return defer.promise;
        }
    }

    // TODO: mock the FileReader service.

    beforeEach(module('InTheFrontRowModule'));

    // initialization of angular $httpBackend service and the 'Management' 
    // controller before each test case
    beforeEach(inject(function ($injector) {
        // Set up the mock http service responses (see angular-mock.js)
        $httpBackend = $injector.get('$httpBackend');

        // backend definition common for all tests
        $httpBackend.when('POST', 'api/gallery').respond(fakeCreateGalleryResponse);
        $httpBackend.when('PUT', fakePutUrl).respond(200, '');

        // Get hold of a scope (i.e. the root scope), needed to create our controller
        $rootScope = $injector.get('$rootScope');

        // Get hold of a $controller, used to create controllers
        var $controller = $injector.get('$controller');

        var httpSvc = $injector.get('$http');
        var logSvc = $injector.get('$log');
        var uploadSvc = new FakeUploadService(httpSvc);
        var fileReaderS = new FakeFileReaderService($injector.get('$q'));
        var thumbnailS = $injector.get('thumbnailSvc');

        // function used in test cases to get a controller object
        createController = function () {
            $controller('NewGalleryController', {
                '$scope': $rootScope,
                '$http': httpSvc,
                '$log': logSvc,
                '$upload': uploadSvc,
                'thumbnailSvc': thumbnailS,
                'fileReaderSvc': fileReaderS
            });
        };
    }));

    it("should retrieve a new gallery ID during initializataion", function (done) {
        $httpBackend.expectPOST('api/gallery');

        $rootScope.$watch('readyForUpload', function (newVal, oldVal) {
            if ($rootScope.readyForUpload != 'undefined' &&
                $rootScope.readyForUpload == true) {
                done();
            }

        });

        var controller = createController();
        $httpBackend.flush();
    });

    it("should use PUT request to upload files to the server", function (done) {
        var controller;
        $httpBackend.expectPUT(fakePutUrl);

        $rootScope.$watch('readyForUpload', function (newVal, oldVal) {
            if ($rootScope.readyForUpload != 'undefined' &&
                $rootScope.readyForUpload == true) {

                // once new gallery had been prepared we can upload the files
                $rootScope.onFileSelect(fakeFilesToUpload);

                // the imageList scope property is used as a dictionary
                $rootScope.$watch('imageList', function (newVal, oldVal) {
                    if ($rootScope.imageList != null &&
                        $rootScope.imageList != 'undefined') {
                        var keys = Object.keys($rootScope.imageList);
                        if (keys.length == 2) {
                            expect($rootScope.imageList[fakeFilesToUpload[0].name]).not.toBe(null);
                            expect($rootScope.imageList[fakeFilesToUpload[0].name].name).toEqual(fakeFilesToUpload[0].name);
                            done();
                        }
                    }
                });
            }
        });


        controller = createController();
        $httpBackend.flush();
    });

});